async function ({url}, {h1}, {externalContext}) {
  const browser = externalContext.get("browser") || await puppeteer.launch();
  externalContext.set("browser", browser);

  const page = await browser.newPage();
  await page.goto(url);

  const h1Element = await page.$("h1");
  if (h1Element) {
    const h1Text = await page.evaluate((el) => el.textContent, h1Element);
    h1.next(h1Text);
  }

  await page.close();
}
